import React from 'react';
import ReactDOM from 'react-dom/client';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <h1>Welcome to the Keeper App!</h1>
    <p>This is a simple React app.</p>
  </React.StrictMode>
);
